import React from "react";
// function component SingOutPage
import SingOutPage from "../Sign-Out/Sign-Out.page";
import { imagesLogo } from "./imaGesLogo";
// redux
import { useSelector } from "react-redux";
// react-router-dom
import { Link, useHistory } from "react-router-dom";
// material
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";
import LocationOnIcon from "@material-ui/icons/LocationOn";
import Grid from "@material-ui/core/Grid";
// css
import "./css/header.style.css";
import { Button, makeStyles, MenuItem, Select } from "@material-ui/core";
import { Menu } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  button: {
    display: "block",
    marginTop: theme.spacing(2),
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
}));

function Header(props) {
  const hisTory = useHistory();

  // menu chọn cụm rạp
  const classes = useStyles();

  const [open, setOpen] = React.useState(false);

  const handleClose = (maHeThongRap) => {
    hisTory.push(`/cinemaDetail/${maHeThongRap}`);
    setOpen(false);
  };
  const handleOpen = () => {
    setOpen(true);
  };
  // menu chọn cụm rạp

  const listShowTime = useSelector((state) => {
    return state.TabNavigationPageReducer.listShowTime; // get data to TabNavigationPageReducer
  });
  const renderCumRap = () => {
    return listShowTime.map((item, index) => {
      return (
        <MenuItem
          key={index}
          onClick={() => {
            handleClose(item.maHeThongRap);
          }}
        >
          {item.maHeThongRap}
        </MenuItem>
      );
    });
  };

  // take data reducer/signIn.reducer
  let signIn = useSelector((state) => {
    return state.signInReducer.auth;
  });
  const userSigIn = JSON.parse(localStorage.getItem("userLogin"));
  if (userSigIn) {
    let signInUpdate = { ...signIn };
    signInUpdate.hoTen = userSigIn.hoTen;
    signIn = signInUpdate;
  }
  return (
    <AppBar position="static" color="inherit" id="navbar" className="header">
      <Toolbar>
        <Grid item xs={2} className="headerGridOne">
          <Typography>
            <Link to="/" className="titleLink">
              <img className="headerloGo" src={imagesLogo.img} alt="logo" />
            </Link>
          </Typography>
        </Grid>
        <Grid item xs={3}>
          <Button className={classes.button} onClick={handleOpen}>
            Chọn Cụm Rạp
          </Button>

          <Menu
            id="simple-menu"
            anchorEl={anchorEl}
            keepMounted
            open={Boolean(anchorEl)}
            onClose={handleClose}
          >
            <Select
              labelId="demo-controlled-open-select-label"
              id="demo-controlled-open-select"
              open={open}
              onClose={handleClose}
              onOpen={handleOpen}
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              {renderCumRap()}
            </Select>
            {renderCumRap()}
          </Menu>
        </Grid>
        <Grid item xs={3} className="headerGridTwo">
          <label>Lịch Chiếu</label>

          <label>Cụm Rạp</label>

          <label>Tin Tức</label>

          <label>Ứng Dụng</label>
        </Grid>
        <Grid item xs={4} className="headerGridThere">
          {signIn.hoTen !== "" ? (
            <>
              <SingOutPage />
              {/* acces to pages/Sign-Out/signout.page-rfc */}
            </>
          ) : (
            <Typography className="headerTitleLinkThere">
              <Link to="/signUp" className="headerTitleThere">
                Đăng Kí {/* acces to pages/Sign-Up/Sign-Up.page-rcc*/}
              </Link>
              <AccountCircleIcon className="headerIconLogIn" />
              <Link to="/signIn" className="headerTitleThere">
                Đăng Nhập {/* acces to pages/Sign-In/Sign-In.page-rfc */}
              </Link>
              <LocationOnIcon className="headerIconLogIn" />
            </Typography>
          )}
        </Grid>
      </Toolbar>
    </AppBar>
  );
}
export default Header;
